                                 {
                                    List<Thing> things = cell.GetThingList(map);
                                    for (int i = things.Count - 1; i >= 0; i--)
                                    {
                                        things[i].Destroy();
                                    }
                                    Building building = cell.GetFirstBuilding(map);
                                    if (building != null)
                                        building.Destroy();
